import React from 'react';
import './App.css';
import Header from './components/Header';

function App() {
  return (
    <div className="min-h-screen bg-background flex flex-col">
      <Header />
      <main className="flex-grow p-6">
        <div className="text-center">
          <h1 className="text-2xl font-semibold mb-4">Insight Agent Dashboard</h1>
          <p className="text-slate-600">
            Dashboard is loading...
          </p>
        </div>
      </main>
      <footer className="bg-white border-t border-slate-200 p-4 text-center text-sm text-slate-500">
        Insight Agent Dashboard Â© {new Date().getFullYear()}
      </footer>
    </div>
  );
}

export default App;
